import { useState } from "react";
import Navbar from "./components/Navbar";
import Intro from "./components/Intro";
import Skills from "./components/Skills";
import Projects from "./components/Projects";
import Achievements from "./components/Achievements";
import Contact from "./components/Contact";

function App() {
  const [page, setPage] = useState("Intro");

  const renderPage = () => {
    switch (page) {
      case "Intro":
        return <Intro />;
      case "Skills":
        return <Skills />;
      case "Projects":
        return <Projects />;
      case "Achievements":
        return <Achievements />;
      case "Contact":
        return <Contact />;
      default:
        return <Intro />;
    }
  };

  return (
    <div className="min-h-screen bg-dark text-white transition-all duration-300">
      <Navbar setPage={setPage} />
      <main className="pt-20 px-6">{renderPage()}</main>
    </div>
  );
}

export default App;
